           <img src=""></img>

          </div>
          <div className="row">
           <img src="../public/images/9023670_phone_call_fill_icon.png"></img>
           
          </div>
          <div className="row">
           <img src="../public/images/8665305_envelope_email_icon.png"></img>
           
          </div>
  
          {/* <Copyright>
            <p>&copy; 2023. Hemant Bhalerao</p>
          </Copyright> */}
  
        </div>
      </section>
    );
        }
